import React, {Component} from 'react';
import { Link } from "react-router-dom";
import { makeStyles } from '@material-ui/core/styles';
import { AppBar, Typography, Toolbar, Tabs, Tab, Box, IconButton, Grid } from '@material-ui/core';
import Paper from "@material-ui/core/Paper";

function a11yProps(index) {
    return {
        id: `simple-tab-${index}`,
        'aria-controls': `simple-tabpanel-${index}`,
    };
}

const useStyles = makeStyles({
    root: {
        flexGrow: 1,
    },
    button: {

    }
});
export default function Menu() {
    const classes = useStyles();
    const [value, setValue] = React.useState(0);

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };

    return (
        <Paper className={classes.root}>
            <Tabs
                value={value}
                indicatorColor="primary"
                textColor="primary"
                onChange={handleChange}
                aria-label="disabled tabs example"
                centered
            >
                <Link to={'/'}><Tab label="Intro" {...a11yProps(0)}/></ Link>
                <Link to={'/about'}><Tab label="About" {...a11yProps(1)}/></ Link>
                <Link to={'/contact'}><Tab label="Contact" {...a11yProps(2)}/></ Link>
                <Link to={'/auth'}><Tab label="Login" {...a11yProps(3)}/></ Link>
                <Link to={'/edition'}><Tab label="Edition"  {...a11yProps(4)}/></ Link>

            </Tabs>
        </Paper>
    );
}
